import React from 'react';

const ProductList = ({ product }) => {
  return (
    <div>
      <h2>Lista de Productos</h2>
      <ul>
        {product.map((item, index) => (
          <li key={index}>{item.nombre}</li>
        ))}
      </ul>
    </div>
  );
};

export default ProductList;
